import React from 'react';
import '../../css/login/AccountForm.css';

class LoginForm extends React.Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="AccountFormContainer">
                <form action="localhost:3001/login" className="AccountForm">
                    <ul>
                        <li >
                            <label for="username">Username: </label>
                            <input type="text" required id="username" name="username"/>
                        </li>
                        <li>
                            <label for="password">Password: </label>
                            <input type="text" required id="password" name="password"/>
                        </li>
                        <li>
                            <button type="submit" className="ContentBtn">Login </button>
                        </li>
                    </ul>
                </form>
                <div className="RecoverPasswordBtn">Recover Password</div>
            </div>            
        );
    }
}

export default LoginForm;
